import { Suspense, lazy } from "react";
import { createBrowserRouter } from "react-router-dom";
import AboutusCompo from "./../Component/pages/AboutUs.jsx"
import HomeCompo from "./../Component/pages/HomeCompo.jsx"
import HeaderCompo from './../Component/comman/header.jsx';
import Contact from './../Component/comman/contact.jsx';

import ContactCompo from './../Component/pages/ContactCompo.jsx';
import ExampleCompo from './../Component/pages/ExampleCompo.jsx';
import ClassCompon from './../Component/ClassComponent/ClassComponentReact.jsx';
import FunctionalCompon from './../Component/FunctionComponent/FunctionalComponentReact.jsx';

import React from "react";
// const ClassCompo = React.lazy(()=>)
// const ClassCompo = lazy(()=>import('./../Component/ClassComponent/ClassCompoRoute.jsx'))
// const ClassCompon = lazy(() => { return import('../Component/ClassComponent/ClassComponentRouter.jsx') })
// const FunctionalCompon = lazy(() => { return import('./../Component/FunctionComponent/FunctionalComponentReact.jsx') })
const router = createBrowserRouter([
    {
        path: "/",
        element: (<HomeCompo />),
    }, {
        path: "/about",
        element: (<><HeaderCompo /><AboutusCompo /></>),
    },
    {
        path: "/contact",
        element: (<><HeaderCompo /><ContactCompo /></>),
    },
    {
        path: "/examples",
        element: (<><HeaderCompo /><ExampleCompo /></>),
        children: [
            {
                path: "/examples/classcomponent/*",
                element: (<Suspense fallback={<>loading...</>} ><ClassCompon /></Suspense>),
                // element: (<Suspense fallback={<>je type krvu hoi....</>} ><ClassCompo /></Suspense>),
            },
            {
                path: "/examples/functionalcomponent/*",
                element: (<Suspense fallback={<>loading...</>} ><FunctionalCompo /></Suspense>)
                // element: (<><FunctionalCompo /></>),
            }
        ]
    }
])

export default router;
